function Guestlayout() {
  const { user } = useContext(AuthContext);

  const x = useNavigate();
  if (!isLogin()) {
      <Navigate to="/" replace={true} />;
    
  } else {
   
    return <Outlet />;
  
  }
}

export default Guestlayout;
